import React from 'react'
import styled from 'styled-components';
import lines from '../assets/lines.png'

const Style = styled.div`


	display: flex;
	flex-direction: column;
	position: relative;
	width: 780px;
	margin-bottom: 250px;
	margin-left: auto;
	margin-right: auto;
	padding-top: 0px;

		&::before {
			position: absolute;
			left: 385px;
			margin-top: 27%;
			margin-left: auto;
			margin-right: auto;
			content:'${(props) => props.phasetext}';
			width: 10px;
			white-space: pre-line;
			line-height: 4rem;
			font-size: 1.2rem;
			font-weight: bold;
			color: #888;
		}

		#fixed {
			position: fixed;
			top: 0;
			border: 5px solid red;
		}

		img {
			position: absolute;


			margin-left: auto; margin-right: auto;
		}

//mobile
	@media (max-width: 770px) {
		width: 100%;

		&::before {
			left: 15px;
		}

		img {
			position: fixed;
			left: 0;
		}
	}

`;

function Timeline(props) {
	return (			
		<Style phasetext={props.phasetext}>
			<div id='fied'>
			<img src={lines} alt='timelines'></img></div>

			{props.children}

		</Style>			
	)
}

export default Timeline;
